import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import BackgroundAnimate from './BackgroundAnimate.js'
import InputURL from './InputURL';
import LinkResult from './LinkResult';

function App() {

  const [InputValue, setInputValue] = useState("")
  var ShortLink = ""
  const setShortLink = (inputValue) =>{
    ShortLink  = inputValue;
  }



  return (
    <div className = "App">
      <InputURL setShortLink = {setShortLink}/>
      <LinkResult shortened = {ShortLink}/>
      <BackgroundAnimate />
    </div>
  )

}

export default App;
